import React from 'react';
import Link from 'next/link'

const Navbar = () => {
  return (
      <nav>
        <menu>
          <Link to='/'>Home</Link>
          <Link to='/about'>About</Link>
        </menu>
      </nav>
  );
};

export default Navbar;
